A_DESCRIPTION:
Renovation of the existing building, including renovation of the facades, changes to the site along Corcoran Street, and installation of one transformer along Parrish Street, with the following conditions: 
	The approval of this COA is not intended to override the ordinance requirements for street trees; 
	Any changes to the attached shall be approved administratively; 
	The screening for the transformer shall either (a) be constructed as an operable, fenced enclosure as close to the equipment as possible, and adaptable into public art, or (b) the applicant shall obtain a variance from the Board of Adjustment to allow the cabinets to be turned into public art pieces without screening elements
	The canopies shall be installed through mortar joints where possible; 
	No darkening or tinted film will be used on the storefront doors; 
	The applicant shall minimize the impact on the granite and limestone from 21c sign along Corcoran Street by locating it so as to use the existing holes from the current SunTrust signs, as much as possible;
	Windows shall be sealed in a manner that is reversible in the future; and 
	Up lighting for the terraces shall be installed with the design approved administratively through a future COA application.
All as per drawgings.
